/**
 * Used to display the loading screen
 * @class
 * @extends cc.Scene
 */
var logoData = "data:image/png;base64,";

cc.MyLoaderScene = cc.Scene.extend(/** @lends cc.MyLoaderScene# */
{
	_logo : null,
	_logoTexture : null,
	_texture2d : null,
	_bgLayer : null,
	_label : null,
	_winSize : null,
	_processLayerLength:0,
	_processLayer:null,
	/**
	 * Constructor
	 */
	ctor : function() {
		cc.Scene.prototype.ctor.call(this);
		this._winSize = cc.Director.getInstance().getWinSize();
	},
	init : function() {
		cc.Scene.prototype.init.call(this);

		//logo
		var logoWidth = 800;
		var logoHeight = 480;
		var centerPos = cc.p(this._winSize.width / 2, this._winSize.height / 2);

		this._logoTexture = new Image();
		var _this = this;
		this._logoTexture.addEventListener("load", function() {
			_this._initStage(centerPos);
			this.removeEventListener('load', arguments.callee, false);
		});
		this._logoTexture.src = logoData;
		this._logoTexture.height = logoHeight;

		// bg
		this._bgLayer = cc.LayerColor.create(cc.c4(32, 32, 32, 255));
		this._bgLayer.setPosition(0, 0);
		this.addChild(this._bgLayer, 0);

		//loading percent
		this._label = cc.LabelTTF.create("Loading... ", "Arial", 14);
		this._label.setColor(cc.c3(255, 255, 255));
		//this._label.setOpacity(0);
		this._label.setAnchorPoint(cc.p(0,0.5));
		this._label.setPosition(cc.pAdd(centerPos, cc.p(0, -200)));
		this._bgLayer.addChild(this._label, 10);

		this._processLayerLength = 400;
		this._processLayer = cc.LayerColor.create(cc.c4b(255, 255, 255, 255), 1, 4);
		this._processLayer.setPosition(cc.pAdd(centerPos, cc.p(0, -220)));
		
		this._bgLayer.addChild(this._processLayer, 10);

	},

	_initStage : function(centerPos) {
		this._texture2d = new cc.Texture2D();
		this._texture2d.initWithElement(this._logoTexture);
		this._texture2d.handleLoadedTexture();
		this._logo = cc.Sprite.createWithTexture(this._texture2d);

		this._logo.setPosition(centerPos);
		this._bgLayer.addChild(this._logo, 1);

		//load resources
		this._logoFadeIn();
	},

	onEnter : function() {
		cc.Node.prototype.onEnter.call(this);
		this.schedule(this._startLoading, 0.3);
	},

	onExit : function() {
		cc.Node.prototype.onExit.call(this);
		//var tmpStr = "Loading...";
		//this._label.setString(tmpStr);
	},

	/**
	 * init with resources
	 * @param {Array} resources
	 * @param {Function|String} selector
	 * @param {Object} target
	 */
	initWithResources : function(resources, selector, target) {
		this.resources = resources;
		this.selector = selector;
		this.target = target;
	},

	_startLoading : function() {
		this.unschedule(this._startLoading);
		cc.Loader.preload(this.resources, this.selector, this.target);
		this.schedule(this._updatePercent);
	},

	_logoFadeIn : function() {
		var logoAction = cc.FadeIn.create(0.5);

		var labelAction = cc.Sequence.create(cc.DelayTime.create(0.15), logoAction.clone());

		this._logo.runAction(logoAction);
		this._label.runAction(labelAction);
	},

	_updatePercent : function() {
		var percent = cc.Loader.getInstance().getPercentage();
		//var tmpStr = "Loading... ";
		this._label.setOpacity(1);
   		this._processLayer.changeWidth(this._processLayerLength * percent / 100);
		if (percent >= 100)
			this.unschedule(this._updatePercent);
	}
});

/**
 * Preload multi scene resources.
 * @param {Array} resources
 * @param {Function|String} selector
 * @param {Object} target
 * @return {cc.MyLoaderScene}
 * @example
 * //example
 * var g_mainmenu = [
 *    {src:"res/hello.png"},
 *    {src:"res/hello.plist"},
 *
 *    {src:"res/logo.png"},
 *    {src:"res/btn.png"},
 *
 *    {src:"res/boom.mp3"},
 * ]
 *
 * var g_level = [
 *    {src:"res/level01.png"},
 *    {src:"res/level02.png"},
 *    {src:"res/level03.png"}
 * ]
 *
 * //load a list of resources
 * cc.MyLoaderScene.preload(g_mainmenu, this.startGame, this);
 *
 * //load multi lists of resources
 * cc.MyLoaderScene.preload([g_mainmenu,g_level], this.startGame, this);
 */
cc.MyLoaderScene.preload = function(resources, selector, target) {

	if (!this._instance) {
		this._instance = new cc.MyLoaderScene();
		this._instance.init();
	}

	this._instance.initWithResources(resources, selector, target);

	var director = cc.Director.getInstance();
	if (director.getRunningScene()) {
		director.replaceScene(this._instance);
	} else {
		director.runWithScene(this._instance);
	}

	return this._instance;
};
var _instance = null;
